import React from 'react';

import Carrosel from '../../components/carrossel';
import Category from '../../components/category';
import Card from '../../components/card';

function Home({Category}){

    return(
        <div>
            <Carrosel/>
            <Category category={Category}/>
            <Card />
        </div>
    )
}

export default Home;
